import ReactDOM from "react-dom/client";

function App() {
  return (
    <div>
      <h1>hello</h1>
      <Pizza />
    </div>
  );
}

function Pizza() {
  return <h2>Pizza!</h2>;
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
